import React, { Component } from "react";

// Once button is click on for company(company is selected), company full profile is then loaded.

export default class CompanyContainer extends Component {
    state = {
        Company: []
    };

    renderCompany() {
        return (
            <>
                {this.state.searchResultsList.map((company) => (
                    <CompanyList 
                        key={uuidv4()}
                        companySymbol={company["1. symbol"]} 
                        companyName={company["2. name"]}
                        companyType={company["3. type"]}
                        companyRegion={company["4. region"]}
                        companyCurrency={company["8. currency"]}
                    />
                ))}
            </>
        )
    }

    render() {
        return (
            <h1>Company LookUp</h1>
        );
    };

}
